script: |
  super -f text -I q9932.spq | sort > q9932.out

inputs:
  - name: q9932.spq
    data: |
      SELECT ALL - col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( NULL ) BETWEEN NULL AND col2 * + + 43 * + col1 * + CAST ( NULL AS REAL ) + + col0 + - 82 + - col1;
  - name: tab2

outputs:
  - name: q9932.out
    data: |
